webpackJsonp([31663103287224],{417:function(A,e){A.exports={data:{markdownRemark:{html:'<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 99.53703703703702%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="beach"\n        title=""\n        src="/static/beach-8cc7af87655fcb7b1e86695ca6429c31-631b1.jpg"\n        srcset="/static/beach-8cc7af87655fcb7b1e86695ca6429c31-30fbd.jpg 200w,\n/static/beach-8cc7af87655fcb7b1e86695ca6429c31-e87dc.jpg 400w,\n/static/beach-8cc7af87655fcb7b1e86695ca6429c31-631b1.jpg 800w,\n/static/beach-8cc7af87655fcb7b1e86695ca6429c31-f04a1.jpg 1080w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  </p>\n<p>It\'s wild to think that in two weeks, my internship will be over, and I\'ll be getting ready to fly home for a few days before starting my senior year at Bucknell.</p>\n<p>One of my favorite things about blogging this summer, is the chance it gives you to step back and reflect on how you\'ve been using your time over the past week.</p>\n<p>Unfortunately (or fortunately), this also makes you acutely aware of all the things you wanted to do, but just haven\'t found the time for.</p>\n<p>I haven\'t recorded that podcast episode that I wanted to.  I haven\'t home cured any meat.  I haven\'t done as much interview prep as I said I would.  And I\'m okay with that.</p>\n<p>This week for the first time in awhile, I started to feel a little run down.  I stay pretty busy here.  My mindset for the summer has pretty much been, "I\'ll sleep in September".  But this week for whatever reason, I started to feel the effects of always doing.  Sometimes the best cure for this is to take it easy for a few days and just go to sleep early as I did this week.</p>\n<p>But pushing from the other side of this, it\'s important to understand that if you\'re like me, you\'re never going to not be "busy".  This is a fact of life.  There will always be an effectively unlimited  list of things you need or want to do, and a limited time to do them.</p>\n<p>If you find yourself telling yourself, "I really want to do x, but I\'m going to wait until y is finished before starting", it\'s almost certainly a fallacy.</p>\n<p>I could tell you the reasons I haven\'t made a podcast episode, but ultimately they\'re just excuses.  I could tell you I\'m waiting until my internship finishes to devote more time to writing, but the truth is I\'ll be just as busy (if not more) with other things as soon as school starts.</p>\n<p>If you\'re feeling overwhelmed or run down, sometimes you need to take a step back and give yourself a break.</p>\n<p>Other times, maybe you just need to embrace it.  Being busy is too easy of an excuse not to do something you genuinely want to do.  There will probably never be a perfect time to start a blog, or a side business, or learn to code.</p>\n<p>So why wait?  You can start today.</p>\n<h2>Unconventional Career Advice</h2>\n<p>Working my first real 9-5 job this summer has forced me to think about my career and what I want to do next year.  I\'ve been thinking about it a lot.  Naturally, I talk to other people about it as well.</p>\n<p>Recently someone said something that really resonated with me:</p>\n<blockquote>\n<p>"Whether public company or startup doesn\'t really matter, how much they pay doesn\'t really matter, almost nothing matters but how well your first job is going to set you up for the future".</p>\n</blockquote>\n<p>Salary, perks, prestige of company, etc. are all distractions.  As long as you continue to grow and learn, any money that you make now will be dwarfed by what you will make later in your career.</p>\n<blockquote>\n<p>"Most people overestimate what they can do in one year and underestimate what they can do in ten years." - Bill Gates</p>\n</blockquote>\n<p>To my fellow seniors thinking about working in tech, I think it\'s worth questioning if Google and Facebook should really be considered the most desirable companies to work at.</p>\n<p>Ask yourself why you want to work there.  If it\'s mostly about salaries and prestige, that\'s okay, but understand that by choosing to work there, you might be getting these things in the short term only to give them up in the long term.</p>\n<p>I\'m not saying these are bad places to work, but I do think there is a real danger of working for a big company, not being able to move fast, and as a result not learning as fast as you could in some of the prime years of your life.</p>\n<p>How do you think about where you want to work?  I\'m always open to conflicting opinions and I\'d love to here your thoughts.</p>\n<hr>\n<p>Although I did spend a lot of time sleeping this week, I still fit in a little fun as well.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 464px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 178.01724137931035%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="fireworks"\n        title=""\n        src="/static/fireworks1-686b59b8bef83d4c423beabb30a87e17-60652.png"\n        srcset="/static/fireworks1-686b59b8bef83d4c423beabb30a87e17-de4e7.png 200w,\n/static/fireworks1-686b59b8bef83d4c423beabb30a87e17-dcdc2.png 400w,\n/static/fireworks1-686b59b8bef83d4c423beabb30a87e17-60652.png 464w"\n        sizes="(max-width: 464px) 100vw, 464px"\n      />\n    </span>\n  </span>\n  </p>\n<h4>Fireworks on Ocean Beach</h4>\n<p>Yesterday I took my first dip in the Pacific ocean of the summer yesterday at ocean beach.  We followed it up with hot dogs, S\'mores, and impromptu illegal fireworks.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 56.17187499999999%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="ribs"\n        title=""\n        src="/static/ribs-9996254a4d5c2f81a64895e6ecb6d477-631b1.jpg"\n        srcset="/static/ribs-9996254a4d5c2f81a64895e6ecb6d477-30fbd.jpg 200w,\n/static/ribs-9996254a4d5c2f81a64895e6ecb6d477-e87dc.jpg 400w,\n/static/ribs-9996254a4d5c2f81a64895e6ecb6d477-631b1.jpg 800w,\n/static/ribs-9996254a4d5c2f81a64895e6ecb6d477-300e3.jpg 1200w,\n/static/ribs-9996254a4d5c2f81a64895e6ecb6d477-ef416.jpg 1280w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  </p>\n<h4>Ribs with the Roomies</h4>\n<p>Today I hit up a Giants day game with some Bucknell friends (Hey Chachi, Tegan, and Vicki).  They lost but it was a fun, relaxing outing nonetheless.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 133.33333333333331%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="baseball"\n        title=""\n        src="/static/baseball-83c6558b403f78c2a18c89890d723280-631b1.jpg"\n        srcset="/static/baseball-83c6558b403f78c2a18c89890d723280-30fbd.jpg 200w,\n/static/baseball-83c6558b403f78c2a18c89890d723280-e87dc.jpg 400w,\n/static/baseball-83c6558b403f78c2a18c89890d723280-631b1.jpg 800w,\n/static/baseball-83c6558b403f78c2a18c89890d723280-300e3.jpg 1200w,\n/static/baseball-83c6558b403f78c2a18c89890d723280-c15ef.jpg 1600w,\n/static/baseball-83c6558b403f78c2a18c89890d723280-3a622.jpg 2400w,\n/static/baseball-83c6558b403f78c2a18c89890d723280-c1f12.jpg 3120w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  </p>\n<h4>AT&#x26;T Park</h4>\n<h2>Reading &#x26; Podcasts</h2>\n<p>Here\'s a few of the pieces I\'ve enjoyed over the past week:</p>\n<ul>\n<li>\n<p><a href="http://haseebq.com/a-hacker-stole-31m-of-ether/">A hacker stole $31M of Ether—how it happened and what it means for Ethereum</a>.  This is a fantastic piece about cryptocurrency as a whole, but especially the vulnerability that was found recently which caused cryptocurrency values to plummet.  I love Haseeb\'s writing because he has a knack for going very deep into a subject, while still making the article remarkably easy to understand</p>\n</li>\n<li>\n<p><a href="http://gonen.blog/what-is-not-going-to-change-in-the-next-10-years">What is not going to change in the next 10 years?</a>.  Jordan Gonen is a fellow bay area intern who has been writing every day for over 500 days.  I love this short piece because it examines a question that not many people are asking, but is clearly important.</p>\n</li>\n<li>\n<p><a href="https://softwareengineeringdaily.com/2017/07/14/coinbase-security-with-philip-martin/">Coinbase Security with Philip Martin</a>.  The entire <a href="https://www.coinbase.com/?r=56af74e3d4a3e711aa00013f">Coinbase</a> series on SEDaily was fantastic not only for diving deep into what kinds of problems Coinbase is trying to solve, but also for learning more about crypto and what the future could hold.  This particular episode also touches on some of the serious issues that the web as a whole is dealing with, which will only continue to grow more prevalent in the coming years.</p>\n</li>\n<li>\n<p><a href="https://thenextweb.com/artificial-intelligence/2017/07/20/machine-learning-has-entered-the-kitchen-and-i-for-one-welcome-our-ai-culinary-overlords/#.tnw_sWY0OZuH">Machine learning has entered the kitchen, and I for one welcome our AI culinary overlords\n</a>.  A few days ago MIT announced it had created an artificial intelligence program that could look at a picture of a food item — like a cookie and tell you the ingredients used to make it.  That\'s pretty cool.</p>\n</li>\n</ul>\n<p>It\'s also worth noting that <a href="https://medium.freecodecamp.org/after-building-my-first-react-native-app-im-now-convinced-it-s-the-future-d3c5e74f8fa8">my React Native</a> article got chosen by a Medium Publication as one of the top 10 React articles for the month!  You can checkout the full list <a href="https://medium.mybridge.co/react-js-top-10-articles-for-the-past-month-v-july-2017-f7f0696dfa76">here</a>.</p>\n<hr>\n<p>That\'s all for this week.  Thanks for being here.</p>',frontmatter:{path:"/interning-in-sf-week-8",title:"Life thoughts and Unconventional Career Advice (Interning in San Francisco Week 8)",date:"2017-07-23T00:00:00.000Z",tag:"Career"}}},pathContext:{}}}});
